void V8HTMLEmbedElement::InstallInterfaceTemplate(v8::Isolate* isolate, const DOMWrapperWorld& world, v8::Local<v8::Template> interface_template)
{
    const WrapperTypeInfo* const wrapper_type_info = V8HTMLEmbedElement::GetWrapperTypeInfo();
    v8::Local<v8::FunctionTemplate> interface_function_template = interface_template.As<v8::FunctionTemplate>();
    v8::Local<v8::ObjectTemplate> instance_object_template = interface_function_template->InstanceTemplate();
    v8::Local<v8::ObjectTemplate> prototype_object_template = interface_function_template->PrototypeTemplate();
    v8::Local<v8::FunctionTemplate> parent_interface_template = wrapper_type_info->parent_class->GetV8ClassTemplate(isolate, world).As<v8::FunctionTemplate>();
    bindings::SetupIDLInterfaceTemplate(
        isolate, wrapper_type_info, instance_object_template, prototype_object_template, interface_function_template, parent_interface_template);

    interface_function_template->SetCallHandler(ConstructorCallback);
    interface_function_template->SetLength(0);
    interface_function_template->SetInterfaceName(V8String(isolate, "HTMLEmbedElement"));
    interface_function_template->SetExceptionContext(v8::ExceptionContext::kConstructor);

    // Named interceptors
    instance_object_template->SetHandler(v8::NamedPropertyHandlerConfiguration(V8HTMLEmbedElement::NamedPropertyGetterCallback,
        V8HTMLEmbedElement::NamedPropertySetterCallback,
        nullptr, // query
        V8HTMLEmbedElement::NamedPropertyDeleterCallback,
        nullptr, // enumerator
        V8HTMLEmbedElement::NamedPropertyDefinerCallback, V8HTMLEmbedElement::NamedPropertyDescriptorCallback, v8::Local<v8::Value>(),
        static_cast<v8::PropertyHandlerFlags>(int32_t(v8::PropertyHandlerFlags::kOnlyInterceptStrings) | int32_t(v8::PropertyHandlerFlags::kHasNoSideEffect))));
    // Indexed interceptors
    instance_object_template->SetHandler(
        v8::IndexedPropertyHandlerConfiguration(V8HTMLEmbedElement::IndexedPropertyGetterCallback, V8HTMLEmbedElement::IndexedPropertySetterCallback,
            nullptr, // query
            V8HTMLEmbedElement::IndexedPropertyDeleterCallback,
            nullptr, // enumerator
            V8HTMLEmbedElement::IndexedPropertyDefinerCallback, V8HTMLEmbedElement::IndexedPropertyDescriptorCallback, v8::Local<v8::Value>(),
            v8::PropertyHandlerFlags::kNone));

    v8::Local<v8::Template> instance_template = instance_object_template;
    v8::Local<v8::Template> prototype_template = prototype_object_template;
    InstallUnconditionalProperties(isolate, world, instance_template, prototype_template, interface_template);
}

